import PropTypes from "prop-types";
import React from "react";
import { useReducer } from "react";
// import { IconComponentNode } from "./IconComponentNode";
import { Icons } from "./Icons";
import "./ss.css";

export const DropDownMenu = ({ property1 }) => {
  const [state, dispatch] = useReducer(reducer, {
    property1: property1 || "default",
  });

  return (
    <div
      className={`drop-down-menu ${state.property1}`}
      onMouseLeave={() => {
        dispatch("mouse_leave");
      }}
      onMouseEnter={() => {
        dispatch("mouse_enter");
      }}
      onClick={() => {
        dispatch("click");
      }}
    >
      <div className="none">
        {["default", "variant-2", "variant-3"].includes(state.property1) && (
          <>None</>
        )}

        {state.property1 === "variant-4" && (
          <p className="p">CHOP: Protocol for Non Hodgkin Lymphoma</p>
        )}
      </div>
      {["default", "variant-2", "variant-4"].includes(state.property1) && (
        <Icons className="icons-instance" />
      )}

      {/* {state.property1 === "variant-3" && (
        <>
          <IconComponentNode className="icons-instance" />
          <div className="menu-list">
            <div className="frame">
              <div className="menu-item">
                <p className="text-wrapper">
                  CHOP: Protocol for Non Hodgkin Lymphoma
                </p>
              </div>
              <div className="menu-item">
                <p className="text-wrapper">
                  AC - Regimen for Non-Metastatic, Locally-Advanced Breast
                  Cancer. Before or after Taxol
                </p>
              </div>
              <div className="menu-item">
                <div className="text-wrapper">CMF-Breast Cancer Regimen</div>
              </div>
              <div className="menu-item">
                <p className="text-wrapper">
                  COP - Regimen for Non-Metastatic Non Hodgkin Lymphoma
                </p>
              </div>
              <div className="menu-item">
                <div className="text-wrapper">Carboplatin + Taxol Regimen</div>
              </div>
              <div className="menu-item">
                <p className="text-wrapper">
                  Single-Agent Cyclophosphamide - Breast Cancer Regimen
                </p>
              </div>
              <div className="menu-item">
                <p className="text-wrapper">
                  Single-Agent Doxorubicin - Breast Cancer Regimen 20 mg/m2
                </p>
              </div>
            </div>
          </div>
        </>
      )} */}
    </div>
  );
};

function reducer(state, action) {
  if (state.property1 === "default") {
    switch (action) {
      case "mouse_enter":
        return {
          property1: "variant-2",
        };
    }
  }

  if (state.property1 === "variant-2") {
    switch (action) {
      case "mouse_leave":
        return {
          property1: "variant-4",
        };

      case "click":
        return {
          property1: "variant-3",
        };
    }
  }

  if (state.property1 === "variant-3") {
    switch (action) {
      case "click":
        return {
          property1: "default",
        };
    }
  }

  if (state.property1 === "variant-4") {
    switch (action) {
      case "mouse_enter":
        return {
          property1: "variant-2",
        };
    }
  }

  return state;
}

DropDownMenu.propTypes = {
  property1: PropTypes.oneOf([
    "variant-4",
    "variant-2",
    "variant-3",
    "default",
  ]),
};
